 * transaction. Therefore, we always must have:
 * MAX_XXX_PER_TX  MAX_XXX_PER_CALL
 *
 * For instance:
 * MAX_NEW_COMMITMENTS_PER_TX  MAX_NEW_COMMITMENTS_PER_CALL
